import React, { Component } from 'react';
import Layout from '../../components/Layout';

class IdolSearch extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Layout>
                {this.props.title}
                basic page
                commit test
            </Layout>
        )
    }
}

IdolSearch.getInitialProps = ({ query }) => {
    return query;
}

export default IdolSearch;
